import React from "react";
import { Container, Row, Col, Button } from "react-bootstrap";

const SideBar = () => {
  return (
    <>
      <Container
        className="col-md-12 d-none d-md-block sidebar text-center"
        fluid
        style={{ backgroundColor: "#3241c9" }}
      >
        <Row>
          <Col>
            <Button className="sidebar-button">
              <h3>Settings</h3>
            </Button>
          </Col>
        </Row>

        <Row>
          <Col>
            <Button className="sidebar-button">
              <h3 s>Log Out</h3>
            </Button>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default SideBar;
